import './App.css';
import  './users.json'
import Navbar from './Components/Navbar';
import Card from './Components/Card';
import Body from './Components/Body';
import Slider from './Components/Slider';

let data = require('./users.json');
console.log(data);
function App() {
  return (<>
  <Navbar  title="Mysite"  />
  <Slider className="container mx-5" />
  <div className="container my-1000000"><Body users={data}/></div>



  </>
  );
}

export default App;
